.developer__inner {
    display: flex;
    flex-wrap: wrap;

    &.overflow {
        width: 100%;
        height: 200px;
        overflow: hidden;
    }

    .developer {
        margin-right: 20px;

        .developer__img {
            width: 150px;
            height: 150px;
            border-radius: 50%;
            overflow: hidden;
            margin-bottom: 10px;
        }
        .developer__info {
            width: 150px;
            text-align: center;
            @include line-one;
            padding-bottom: 40px;
        }
    }
}
@media (max-width: 1200px){
    .developer__inner {
        justify-content: center;

        .developer {
            margin-right: 0;
            
            .developer__img {
                width: 130px;
                height: 130px;
                margin: 10px auto;
            }
            .developer__info {}
        }   
    }
}
@media (max-width: 800px){
    .developer__inner {
        margin-top: 70px;
    }
}
